<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <title>CSC413 - Dream Villa VR</title>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/aframe/1.4.2/aframe.min.js"></script>
  <style>
    body { margin: 0; overflow: hidden; }
    #info {
      position: fixed; bottom: 16px; left: 50%; transform: translateX(-50%);
      background: rgba(0,0,0,0.55); color: #fff; padding: 8px 18px;
      border-radius: 20px; font-family: sans-serif; font-size: 13px;
      pointer-events: none; z-index: 999;
    }
  </style>
</head>
<body>
<div id="info">WASD = Move &nbsp;|&nbsp; Mouse = Look &nbsp;|&nbsp; Click to lock cursor</div>

<a-scene
  background="color: #0a0f1e"
  shadow="type: pcfsoft; enabled: true"
  renderer="antialias: true; colorManagement: true; sortObjects: true">

  <!-- ═══════════════════════════════════════
       CUSTOM COMPONENTS
  ═══════════════════════════════════════ -->
  <script>
    // Floating bobbing
    AFRAME.registerComponent('float', {
      schema: { speed: {default:1}, amount: {default:0.08} },
      init() { this.t = Math.random()*100; this.baseY = null; },
      tick(time, dt) {
        this.t += dt * 0.001 * this.data.speed;
        if (this.baseY === null) this.baseY = this.el.object3D.position.y;
        this.el.object3D.position.y = this.baseY + Math.sin(this.t) * this.data.amount;
      }
    });
    // Pool water ripple
    AFRAME.registerComponent('pool-water', {
      schema: { speed: {default:1.2} },
      init() { this.t = 0; },
      tick(time, dt) {
        this.t += dt * 0.001 * this.data.speed;
        const s = 1 + Math.sin(this.t * 2.5) * 0.013;
        this.el.object3D.scale.set(s, 1, 1 + Math.cos(this.t * 1.8) * 0.013);
        const mesh = this.el.getObject3D('mesh');
        if (mesh && mesh.material) {
          mesh.material.color.setRGB(
            0.1 + Math.sin(this.t)*0.02,
            0.44 + Math.sin(this.t*1.3)*0.04,
            0.65 + Math.cos(this.t*2)*0.07
          );
        }
      }
    });
    // Ceiling fan spin
    AFRAME.registerComponent('spin', {
      schema: { speed: {default:200} },
      tick(time, dt) {
        this.el.object3D.rotation.y += (dt/1000)*(this.data.speed*Math.PI/180);
      }
    });
    // Flickering light
    AFRAME.registerComponent('flicker', {
      tick() {
        this.el.setAttribute('light','intensity', 0.55 + Math.random()*0.5);
      }
    });
    // Tree sway
    AFRAME.registerComponent('sway', {
      schema: { speed:{default:0.6}, amount:{default:2} },
      init() { this.t = Math.random()*100; },
      tick(time, dt) {
        this.t += dt*0.001*this.data.speed;
        this.el.object3D.rotation.z = (Math.sin(this.t)*this.data.amount)*Math.PI/180;
        this.el.object3D.rotation.x = (Math.cos(this.t*0.7)*this.data.amount*0.5)*Math.PI/180;
      }
    });
    // Wheel spin
    AFRAME.registerComponent('wheel-spin', {
      tick(time,dt) { this.el.object3D.rotation.x += (dt/1000)*2; }
    });
  </script>
